(9, 'Mike Smith', 'no-replyagexia@gmail.com', '83264777221', 'Howdy \r\n \r\nI have just checked  techknowsity.com for onsite errors and saw that your website has a handful of issues which should be addressed. \r\n \r\nNo matter what you are offering or selling, having a poor optimized site, full of bugs and errors, will never help your ranks. \r\n \r\nLet us fix your wordpress site errors today and get your ranks reach their full potential \r\n \r\nMore info: \r\nhttps://www.digital-x-press.com/product/wordpress-seo-audit-and-fix-service/ \r\n \r\n \r\nRegards \r\nMike Smith'),
(10, 'Dena', 'dena@techknowsity.com', '0512-6329643', 'Good day \r\n\r\nI wanted to reach out and let you know about our new dog harness. It\'s really easy to put on and take off - in just 2 seconds - and it\'s personalized for each dog. \r\nPlus, we offer a lifetime warranty so you can be sure your pet is always safe and stylish.\r\n\r\nWe\'ve had a lot of success with it so far and I think your dog would love it. \r\n\r\nGet yours today with 50% OFF:  https://caredogbest.shop\r\n\r\nFREE Shipping - TODAY ONLY! \r\n\r\nHave a great time, \r\n\r\nDena'),
(11, 'Grantcouby', 'yasen.krasen.13+72889@mail.ru', '88374153219', 'Ufieuhdidhefh wjdwdjqwidjwefhwfakj oijofqwfbvsdfjfwej ijwqiofjewuhfwedjawdhewh ouhwidwjpouweiofeiouqwruio ioqwiwuifewifjfifhw jiwfjiewhfewgiewufewio techknowsity.com'),
(12, 'ODOZIAKUCHI', 'hello@odoziakuchi.com', '84284329313', 'Good day! \r\n \r\nLooking for Heirloom fine Jewellery? \r\n \r\nODOZIAKUCHI is an exciting jewellery brand that celebrates individuality, our mission is to create sentimental jewellery with meaning that move on to become heirlooms for generations. \r\n \r\nWe pride ourselves in making sustainable timeless jewellery with endless versatility and aesthetics. We are driven to making fine jewellery that can be worn for everyday looks or occasional wear. \r\n \r\nWe pride ourselves in being open and honest, staying true to our mission. All our jewellery are hallmarked at the Assay Office in London which guarantees our customers of the authenticity of there jewels. \r\n \r\nWe welcome you to follow us on our journey to bringing a full range of jewellery pieces that tell a story. \r\n \r\nYou can visit our website and view our social media channels to get inspired! Simply click on the below links \r\n \r\nWebsite: https://odoziakuchi.com/ \r\n \r\nEmail: info@odoziakuchi.com \r\n \r\nBlog:https://odoziakuchi.com/ethical-diamonds/ \r\n \r\nInstagram: https://www.instagram.com/odoziakuchi/ \r\n \r\nFacebook: https://m.facebook.com/Odoziakuchi \r\n \r\nWe look forward to having you with us on this journey \r\n \r\nKind regards, \r\n \r\nODOZIAKUCHI'),
(13, 'Hans', 'hans@techknowsity.com', '078 4619 7755', 'Hey \r\n\r\nI wanted to reach out and let you know about our new dog harness. It\'s really easy to put on and take off - in just 2 seconds - and it\'s personalized for each dog. \r\nPlus, we offer a lifetime warranty so you can be sure your pet is always safe and stylish.\r\n\r\nWe\'ve had a lot of success with it so far and I think your dog would love it. \r\n\r\nGet yours today with 50% OFF: https://caredogbest.shop\r\n\r\nFREE Shipping - TODAY ONLY! \r\n\r\nBest, \r\n\r\nHans'),
(14, 'Tigran Ayrapetyan', 'ujn2esbgakah@opayq.com', '84821566769', 'Hello, \r\n \r\nWe provide funding through our venture capital company to both start-up and existing companies either looking for funding for expansion or to accelerate growth in their company. \r\nWe have a structured joint venture investment plan in which we are interested in an annual return on investment not more than 10% ROI. We are also currently structuring a convertible debt and loan financing of 3% interest repayable annually with no early repayment penalties. \r\n \r\nWe would like to review your business plan or executive summary to understand a much better idea of your business and what you are looking to do, this will assist in determining the best possible investment structure we can pursue and discuss more extensively. \r\n \r\n \r\nI hope to hear back from you soon. \r\n \r\nSincerely, \r\n \r\nTigran Ayrapetyan \r\nInvestment Director \r\nDevcorp International E.C. \r\nP.O Box 10236 Shop No. 305 \r\nFlr 3 Manama Centre, Bahrain \r\nEmail: tigran.a@devcorpinternationalec.com'),
(15, 'Dr. Anthony', 'drabreiner4@gmail.com', '87597838215', 'Greetings, \r\n \r\nI am a research consultant working with a leading laboratory in the United Kingdom. Our company, CLJ PHARMA, is a highly respected and successful pharma manufacturer. We produce a wide range of life-saving biopharmaceutical products and medical consumables. \r\n \r\nI have an exciting business proposal to share with you. If you\'re interested, please contact me at  anthony_breiner@drbreiner.com. You have the option to decline after hearing the details, but I assure you won\'t regret considering this opportunity. \r\n \r\nLooking forward to your positive response. \r\n \r\nRegards, \r\nDr. Anthony'),
(16, 'Celesta', 'celesta@gilley.medicopostura.com', '06-58775424', 'Hey there \r\n\r\nLooking to improve your posture and live a healthier life? Our Medico Postura™ Body Posture Corrector is here to help!\r\n\r\nExperience instant posture improvement with Medico Postura™. This easy-to-use device can be worn anywhere, anytime – at home, work, or even while you sleep.\r\n\r\nMade from lightweight, breathable fabric, it ensures comfort all day long.\r\n\r\nGrab it today at a fantastic 60% OFF: https://medicopostura.com\r\n\r\nPlus, enjoy FREE shipping for today only!\r\n\r\nDon\'t miss out on this amazing deal. Get yours now and start transforming your posture!\r\n\r\nEnjoy, \r\n\r\nCelesta'),
